import App from "next/app"

class MyApp extends App {
  render() {
   const { Component, pageProps } = this.props;

   return (
    <div>
      <Component {...pageProps} />
      <style jsx global>{`
      @font-face {
        font-family: "";
        src: url('');
        font-weight: bold;
        font-style: normal;
        font-display: swap;
      }
      `}</style>
    </div>
   )
  }
}

export default MyApp
